import React from 'react';
import Typewriter from 'typewriter-effect';
import { node } from 'prop-types';


const Header = () => {
  const bemVindo = <h1>Bem Vindo!</h1>;
  const welcome = <h1>{`You're Welcome!`}</h1>;

  return (
    <div>
      <Typewriter
        onInit={(typewriter) => {
          typewriter
          .typeString(`${bemVindo}`)
          .pauseFor(2000)
          .deleteAll()
          .typeString(welcome)
          .start();
        }} />
    </div>
  );
}

Header.propTypes = {
  children: node.isRequired,
  // bemVindo: node.isRequired,
}

export default Header;
